var tipuesearch = {"pages": [{'title': 'About', 'text': '課程名稱: 計算機程式 \n 個人倉儲： https://github.com/liyu15679-glitch/work \n 個人網站： https://liyu15679-glitch.github.io/work/content/index.html \n 程式操作影片: https://www.youtube.com/watch?v=DpX1SymUuSU \n 課程評分: \n 學習心得報告 (60%)  - MS Teams 線上參與， 6人一組 每三週發表學習心得。 \n w3、w7、w10、w14、w17、w18 \n 學習心得報告主題: \n w3: 什麼是 git, GitHub, gist 與 cmsimde? 如何使用這些工具？為什麼要使用這些工具？ ( 動態模擬 ) \n w7: Brython 是什麼？如何在瀏覽器配置 Brython 環境？ Brython 能做什麼？ ( Brython ,  Examples ) \n w10: 如何在瀏覽器中模擬機器人作動？ ( 機器人作動 ) \n w14: 在瀏覽器中模擬機器人作動的目的是什麼？ ( otto_robot.7z ,\xa0 Plotter ,\xa0 open_duck_mini.7z  , https://webots.cloud/AcTNYs0 ) \n w17 ( 1b 採 Youtube 影片簡報 ): 計算機程式課程學到了什麼？ \n w18: 課程總結 \n 個人與分組網站維護 (40%)  - 每週至少兩次推送與課程進度相關的學習內容與心得。 \n w9 期中自評、w18 期末自評 \n \n', 'tags': '', 'url': 'About.html'}, {'title': 'report', 'text': '', 'tags': '', 'url': 'report.html'}, {'title': 'w3', 'text': '什麼是 git? \n Git 是一套分散式版本控制系統（Distributed Version Control System, DVCS）， 主要功能在於協助開發者進行版本管理。當專案中的檔案隨著時間不斷被修改時，Git 會完整記錄每一次變更，形成可追溯的歷史紀錄。透過這些紀錄，使用者可以清楚知道是誰在什麼時間點修改了哪些內容，並且在需要時隨時回復到過去的任一版本，避免因錯誤修改而造成無法挽回的損失。 \n 除了版本控管之外，Git 也大幅提升了多人協作的效率。在團隊開發情境中，多位成員可以同時對同一個專案進行開發，各自提交自己的變更。Git 會在整合這些變更時協助處理合併的流程，並在發生衝突時明確指出問題位置，讓團隊成員能有系統地解決衝突，而不必擔心彼此覆蓋對方的成果。 \n 此外，Git 也是一項重要的風險控管工具。開發者可以透過分支機制，在不影響主要穩定版本的情況下嘗試新功能或進行實驗性修改。即使開發方向不如預期，也能輕易捨棄該分支，不會對主程式造成影響，從而降低開發過程中的風險。 \n 在 Git 的世界裡，檔案通常會經歷三個主要的區域： \n \n \n 工作目錄 (Working Directory) ：你正在編輯檔案的地方（就是你的資料夾）。 \n \n \n 暫存區 (Staging Area) ：你挑選準備要存檔的檔案（像是購物車，還沒結帳）。 \n \n \n 本地儲存庫 (Local Repository) ：正式存檔紀錄的地方（按下 Commit 後，這份快照就會永久保存）。 \n \n \n w7 \n', 'tags': '', 'url': 'w3.html'}, {'title': 'w10', 'text': '', 'tags': '', 'url': 'w10.html'}, {'title': 'w14', 'text': '', 'tags': '', 'url': 'w14.html'}, {'title': 'w17', 'text': '', 'tags': '', 'url': 'w17.html'}, {'title': 'w18', 'text': '\n', 'tags': '', 'url': 'w18.html'}, {'title': 'Brython', 'text': 'Brython  是一個將  Python  語法編譯為  JavaScript  的工具，能直接在瀏覽器中以  Python  撰寫前端網頁程式。 \n 1 add to 100 機器人巡邏 自由行 \n  導入 brython 程式庫  \n \n \n \n \n  啟動 Brython  \n \n \n \n  導入 FileSaver 與 filereader  \n \n \n \n \n  導入 ace  \n \n \n \n \n \n \n  導入 gearUtils-0.9.js Cango 齒輪繪圖程式庫  \n \n \n \n \n \n \n  請注意, 這裡使用 Javascript 將 localStorage["kw_py_src1"] 中存在近端瀏覽器的程式碼, 由使用者決定存檔名稱 \n \n \n \n  累加程式開始  \n \n  累加程式結束     機器人巡邏程式開始  \n \n  機器人巡邏程式結束  \n  機器人自由行程式開始  \n \n \n \n  機器人自由行程式結束  \n  add 1 to 100 開始  \n \n \n  add 1 to 100 結束 \n  editor1 開始  \n  用來顯示程式碼的 editor 區域  \n \n  以下的表單與按鈕與前面的 Javascript doSave 函式以及 FileSaver.min.js 互相配合  \n  存擋表單開始  \n Filename:  .py   \n  存擋表單結束  \n \n  執行與清除按鈕開始  \n Run   Output   清除輸出區 清除繪圖區 Reload \n  執行與清除按鈕結束  \n \n  程式執行 ouput 區  \n \n  Brython 程式執行的結果, 都以 brython_div1 作為切入位置  \n \n  editor1 結束   ##########################################  \n 從 1 累加到 100 part2: \n 1 add to 100 cango_three_gears BSnake AI Tetris \n  請注意, 這裡使用 Javascript 將 localStorage["kw_py_src2"] 中存在近端瀏覽器的程式碼, 由使用者決定存檔名稱 \n \n \n \n  add 1 to 100 part2 開始  \n \n \n  add 1 to 100 part2 結束 \n  editor2 開始  \n  用來顯示程式碼的 editor 區域  \n \n  以下的表單與按鈕與前面的 Javascript doSave 函式以及 FileSaver.min.js 互相配合  \n  存擋表單開始  \n Filename:  .py   \n  存擋表單結束  \n \n  執行與清除按鈕開始  \n Run   Output   清除輸出區 清除繪圖區 Reload \n  執行與清除按鈕結束  \n \n  程式執行 ouput 區  \n \n  Brython 程式執行的結果, 都以 brython_div1 作為切入位置  \n \n  editor2 結束  \n \n', 'tags': '', 'url': 'Brython.html'}, {'title': 'Pyodide3', 'text': 'Pyodide3 則在  Pyodide  與  Pyodide2  頁面架構下，進一步導入  robot_w_world.py ，在既有的水平圍牆  north.png  與垂直圍牆  east.png  檔案之外，加入  carrot.png 、 grass.png  與  pale_grass.png  等圖檔。並且擴充可從 URL 讀進 json 格式的 world 變數功能，以便製作出更多元的場景任務，要求機器人執行。 \n 其中 src URL 變數，可以將網路上的機器人控制程式導入 Pyodide3 頁面外，world URL 變數則可以導入源自  Reeborg  機器人程式所設定的 json 格式場景。 \n 由於 Reeborg 系統中的 png 圖檔均非透明背景， robot_w_world.py \xa0必須利用 HTML 中的 CANVAS，將關鍵的白色背景，以透明的方式顯示。 \n src URL 變數讀進  turn_right 程式 ，而 world URL 變數則讀進  harvest2.json ，執行 結果 。 \n 讀進  harvest3.json , 執行 結果 。 \n \n \n \n version   hello   1 add to 100   機器人巡邏   自由行   numpy_ode \n  Ace Editor Scripts  \n \n \n \n \n \n \n \n \n  Editor 1  \n \n Run   Output   清除輸出區   Reload \n \n \n \n \n \n 從 1 累加到 100 part2: \n 1 add to 100 \n  Editor 2  \n \n Run   Output   清除輸出區   Reload \n \n \n \n \n \n \n', 'tags': '', 'url': 'Pyodide3.html'}]};